import React from "react";
import { Container, Row, Col, Card, Button } from "react-bootstrap";
import "./Rooms.css";

const Rooms = () => {
  const roomData = [
    {
      img: "https://res.cloudinary.com/dynx8bauw/image/upload/v1761822641/deluxeRoom_ysyd2x.jpg",
      title: "Standard Room",
      guests: 2,
      size: "250 sq ft",
      desc: "Cozy room perfect for couples with essential amenities and comfortable bedding.",
      price: 1999,
      amenities: ["WiFi", "TV", "AC", "Breakfast"],
    },
    {
      img: "https://res.cloudinary.com/dynx8bauw/image/upload/v1761822642/premiumRoom_uupmcg.jpg",
      title: "Deluxe Room",
      guests: 3,
      size: "350 sq ft",
      desc: "Spacious room with modern amenities and elegant interiors for a comfortable stay.",
      price: 2999,
      amenities: ["WiFi", "TV", "AC", "Mini Bar", "Breakfast"],
    },
    {
      img: "https://res.cloudinary.com/dynx8bauw/image/upload/v1761822642/traditionalRoom_sdbglh.jpg",
      title: "Traditional Suite",
      guests: 3,
      size: "400 sq ft",
      desc: "Experience authentic Banarasi hospitality with traditional decor and modern comforts.",
      price: 3499,
      amenities: ["WiFi", "TV", "AC", "Sitting Area"],
    },
  ];

  return (
    <section>
      {/* Header Section */}
      <div
        className="text-center py-5 text-white"
        style={{ backgroundColor: "#E54C19" }}
      >
        <h2 className="fw-bold">Our Rooms & Suites</h2>
        <p>
          Choose from our range of comfortable and luxurious accommodations.
        </p>
      </div>

      {/* Rooms Section */}
      <Container className="my-5">
        <Row className="g-5">
          {roomData.map((room, index) => (
            <Col md={4} key={index}>
              <Card className="shadow-sm h-100 border-0 rounded-4 overflow-hidden room-card">
                {/* Image */}
                <div className="position-relative">
                  <Card.Img
                    variant="top"
                    src={room.img}
                    alt={room.title}
                    loading="lazy"
                    style={{ height: "230px", objectFit: "cover" }}
                  />

                  {/* Price Bar */}
                  <div className="position-absolute top-0 end-0 bg-white px-3 py-1 rounded-start price-tag shadow-sm">
                    <span
                      style={{
                        color: "#E54C19",
                        fontWeight: "600",
                        marginRight: "2px",
                      }}
                    >
                      ‚Çπ{room.price}
                    </span>
                    <span
                      style={{
                        color: "#555",
                        fontSize: "0.9rem",
                        fontWeight: "500",
                      }}
                    >
                      /night
                    </span>
                  </div>
                </div>

                {/* Card Content */}
                <Card.Body>
                  <Card.Title className="mb-2 fw-semibold">
                    {room.title}
                  </Card.Title>
                  <p className="text-muted mb-2 small">
                    üë• {room.guests} Guests &nbsp; | &nbsp; üìê {room.size}
                  </p>
                  <Card.Text className="small mb-3">{room.desc}</Card.Text>
                  <p className="fw-semibold mb-2 small">Amenities:</p>
                  <div className="d-flex flex-wrap gap-2 mb-3">
                    {room.amenities.map((a, i) => (
                      <span
                        key={i}
                        className="badge bg-light text-dark border border-secondary small"
                      >
                        {a}
                      </span>
                    ))}
                  </div>

                  <Button variant="dark" className="w-100 fw-semibold book-btn">
                    Book Now
                  </Button>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>

      {/* Hover Animation Styles */}
      <style jsx="true">{`
        .book-btn {
          background-color: #e54c19 !important;
          border: none !important;
          border-radius: 10px;
          transition: all 0.3s ease-in-out;
          box-shadow: 0 0 0px rgba(229, 76, 25, 0);
        }

        .book-btn:hover {
          background-color: #ff5e29 !important;
          box-shadow: 0 0 12px rgba(229, 76, 25, 0.6);
          transform: translateY(-2px);
        }

        .book-btn:active {
          transform: scale(0.97);
        }

        .room-card {
          transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .room-card:hover {
          transform: translateY(-5px);
          box-shadow: 0 8px 18px rgba(0, 0, 0, 0.1);
        }

        .price-tag {
          border-bottom-left-radius: 10px;
          border-top-left-radius: 10px;
        }
      `}</style>
    </section>
  );
};

export default Rooms;
